import React, { Component } from 'react';
import styles from "./Cards.module.css"
import Card from "./Card.js"
import eifel from "../images/Eifel.jpg"
import fire from "../images/Fire.jpg"
import dog from "../images/Dog.jpg"
import man from "../images/Man.jpg"

class Cards extends Component {
    render() {
        return (
            <div className={styles.container}>
                <Card image={eifel} name="Eifel Tower" place="Paris"/>
                <Card image={fire} name="Fire Woods" place="Jungle"/>
                <Card image={dog} name="Sleepy Dog" place="Caffe"/>
                <Card image={man} name="A hidden man" place="Library"/>
            </div>
        );
    }
}

export default Cards;
